import { link } from "fs"

interface NavbarProps {
    links: {
        text: string
        url: string
    }[]
}

export const Navbar: React.FC<NavbarProps> = ({ links }) => {
    return(
        <nav>
            <ul>
                {links.map((link: any) =>
                    <li key={link.url}>
                        <a href={link.url}>{link.text}</a>
                    </li>
                )}
            </ul>
        </nav>
    )
}
